import './App.css';
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
import Navbar from './layout/Navbar';
import Myform from './layout/Configureform';
import SavedConfigurations from './layout/SavedConfigurations';

function App() {
  return (
    <div className="App">
      <Navbar/>
      <Myform/>
      <SavedConfigurations/>
    </div>
  );
}

export default App;
